CREATE TABLE metabolites (
	id INT NOT NULL AUTO_INCREMENT,
	precursorMz FLOAT,
	retentionTime FLOAT,
	msLevel INT,
	highMz FLOAT,
	lowMz FLOAT,
	bit_precision INT, 
	peaks VARCHAR(15000),
	PRIMARY KEY (id)
);

